### Counting DNA nucleotides ###

def DNACount(string):
    DNADict = {'A':0, 'C':0, 'G':0, 'T':0}
    for symbol in string:
        DNADict[symbol] += 1
    return DNADict

sample_string = 'AGCTTTTCATTCTGACTGCAACGGGCAATATGTCTCTGTGTGGATTAAAAAAAGAGTGTCTGATAGCAGC'
test_string = ''
print(' '.join(str(num) for num in list(DNACount(test_string).values())))